	public static String getHmacMd5Bytes(String str) throws Exception {
		
		if("".equals(str)||Constants.NULL_STRING_FLAG.equals(str))
			return Constants.NULL_STRING_FLAG;
		
		StringBuffer sb = new StringBuffer();
		str=str.length()+str;
		sb.append(str);
		str=sb.reverse().toString();
		sb.delete(0, sb.length());
		
		
		String result = null;
		SecretKey sk = new SecretKeySpec(key.getBytes("UTF-8"), "HmacMD5");
		Mac mac = Mac.getInstance("HmacMD5");
		mac.init(sk);
		byte[] temp = mac.doFinal(str.getBytes("UTF-8"));
		
		for (byte b : temp) {
			if (Integer.toHexString(0xFF & b).length() == 1) {
				sb = sb.append("0" + Integer.toHexString(0xFF & b));
			} else {
				sb = sb.append(Integer.toHexString(0xFF & b));
			}
			result = sb.toString();
		}
		return result;
	}

	/**
	 * 分割字符串，双引号、逗号分割
	 * 
	 * @param str
	 * @return
	 */
	public static String[] directSplit(String str) {
		String[] result = str.split("\",\"");
		
		if (result.length != 0) {
			result[0] = result[0].replaceAll("^\"", "");
			result[result.length - 1] = result[result.length - 1].replaceAll(
					"\"$", "").trim();
		}
		return result;
	}

	@SuppressWarnings("unchecked")
	public static Map<String, String> getJsonMap(String str) throws JsonParseException, JsonMappingException, IOException {

		ObjectMapper mapper = new ObjectMapper();
		Map<String, String> map = mapper.readValue(str.replace("\\", ""), Map.class);
		

		return map;

	}
	
	@SuppressWarnings("unchecked")
	public static Map<String, String> getJsonMapV2(String str) throws JsonParseException, JsonMappingException, IOException {
       
		String[] tokens=str.replace("\\\"", "").replace("  ", " ").split("\"\\. \"");
        StringBuilder sb=new StringBuilder();

        for(String item:tokens){
        	if(item.startsWith("deviceName")||item.startsWith("networkMode")){
        		continue;
        	}
        	
        	else if(item.endsWith("}")){
        		sb.append(item+"\"");
        	}else if(item.endsWith(": "))
        		sb.append(item+"\"\""+", \"");
        	else {
        		sb.append(item+"\", \"");
        	}
        	
        }
        System.out.println(sb.toString());
		ObjectMapper mapper = new ObjectMapper();
		Map<String, String> map = mapper.readValue(sb.toString().replace("\\", ""), Map.class);
		

		return map;

	}
	
