	public static String getDataPkgValueByKey(Map<String,String> map,String key){
		if (map != null && map.containsKey(key)) {
			String value=map.get(key);
			if("".equals(value)||"0156".equals(value)){
				return Constants.NULL_STRING_FLAG;
			}else{
				return map.get(key);
			}
			
		} else
			return Constants.NULL_STRING_FLAG;
		
	}
	
    /**
     * 地区代码，0001-0155，0157-0999，境外
     * @param map
     * @param key
     * @return
     */
	public static String getDataPkgValueByKeyV1(Map<String,String> map,String key){
		if (map != null && map.containsKey(key)) {
			String value=map.get(key);
			if("".equals(value)||"0156".equals(value)){
				return Constants.NULL_STRING_FLAG;
			}else{
				int intValue=Integer.parseInt(value);
				if(intValue>0&&intValue<=999&& intValue!=156)
					return  Constants.FOREIGN_STRING;
				return map.get(key);
			}
			
		} else
			return Constants.NULL_STRING_FLAG;
		
	}
	
	
