	/**
	 * 比较两条记录某个字段是否一致
	 * @param item1
	 * @param item2
	 * @param method
	 *        mobile:卡片手机号
	 *        deviceNo:设备手机号
	 *        seid:设备id
	 *        
	 * @return
	 */
	public static int compareItem(MapItem item1,MapItem item2,CompareColumn method){
		
		if (item1 != null &&item2!=null) {
			String str1="";
			String str2="";
			if(CompareColumn.IP.equals(method)){
				str1=item1.getIp();
				str2=item2.getIp();
			}else if(CompareColumn.IP_PROV.equals(method)){
				str1=item1.getIpProvRegionCd();
				str2=item2.getIpProvRegionCd();
			}else if(CompareColumn.DEVICE_TYPE.equals(method)){
				str1=item1.getDeviceType();
				str2=item2.getDeviceType();
			}else if(CompareColumn.CAPTURE_METHOD.equals(method)){
				str1=item1.getCaptureMethod();
				str2=item2.getCaptureMethod();
			}else if(CompareColumn.SEID.equals(method)){
				str1=item1.getSeid();
				str2=item2.getSeid();
			}else if(CompareColumn.MCHNT_USR_ID.equals(method)){
				str1=item1.getMchntUsrId();
				str2=item2.getMchntUsrId();
			}else if(CompareColumn.DEVICE_NUMBER.equals(method)){
				str1=item1.getDeviceNumber();
				str2=item2.getDeviceNumber();
			}else if(CompareColumn.JWD_PROV.equals(method)){
				str1=item1.getJwdProvRegionCd();
				str2=item2.getJwdProvRegionCd();
			}else if(CompareColumn.DEVICE_NO_PROV.equals(method)){
				str1=item1.getDeviceNoProvRegionCd();
				str2=item2.getDeviceNoProvRegionCd();
			}else if(CompareColumn.GOODS_TP.equals(method)){
				str1=item1.getGoodsTp();
				str2=item2.getGoodsTp();
			}

			if (Constants.NULL_STRING_FLAG.equals(str1) 
					|| Constants.NULL_STRING_FLAG.equals(str2) 
					|| "".equals(str1)
					|| "".equals(str2)) {
				return Constants.NULL_INT_FLAG;
			} else if (str1.equals(str2)) {
				return Constants.TRUE_FLAG;
			} else {
				return Constants.FALSE_FLAG;
			}
		} else
			return Constants.NULL_INT_FLAG2;
		
	}
	
	
