	  public static String upopToUpmpString(String str){
		  String[] tokens=directSplit(str);
		  if(tokens.length==Constants.UPMP_COLUMNS_NUM){
			  return str;
		  }else{
			  StringBuilder sb=new StringBuilder();
			  for(int i=0;i<tokens.length;i++){
				  sb.append("\""+tokens[i]+"\"");
				  if(i==52)
					  sb.append(",\"\",\"\"");
				  if(i!=tokens.length-1)
					  sb.append(",");
			  }
//			  System.out.println(sb.toString());
			  return sb.toString();
		  }
	  }	
	
	
